function Render_Template_Labo(n,t){var u=document.getElementById(t),i,r;if(u!=null){u.innerHTML="";let f="";if(n&&n.length>0)for(i=0;i<n.length;i++){let e=n[i],u=e.Quiz,t="";for(r=0;r<u.length;r++)itemQuiz=u[r],t=t+Render_Labo_Questions(itemQuiz);f=f+t}document.getElementById(t).innerHTML=f}}function Render_Labo_Questions(n){let t='<div class="row row-cols-1 row-cols-sm-2 row-cols-md-4 row-cols-lg-5 text-sm text-dark  px-3 py-2"><span class="w-100">'+n.title+"<\/span>",i=n.listitems;if(i&&i.length>0)for(var r=0;r<i.length;r++){let n=i[r];t=t+Render_Item_Check_List(n)}return t=t+"<\/div>"}function Render_Item_Check_List(n){let t="";switch(n.type){case"checkbox":t='<div class="form-check"><input class="checkQA form-check-input pr-2" value="small" type="checkbox" id="'+n.id+'" data-id="'+n.id+'"><label class="text-dark text-sm font-weight-normal">'+n.label+"<\/label><\/div>";break;case"checkboxOther":t='<div class="input-group mb-3"><div class="input-group-text"><div class="form-check pt-1"><input class="form-check-input mt-0 checkQA" value="small" type="checkbox" id="'+n.id+'" data-id="'+n.id+'" ><\/div><\/div><input type="text" class="form-control" placeholder=eg .other answer" id="other'+n.id+'" onchange="getValueCheckboxOther('+n.id+')"><\/div>';break;case"checkbox_fillnumber":t='<label class="text-dark text-sm font-weight-normal px-0">'+n.label+'<\/label><div class="input-group mb-3"><div class="input-group-text"><div class="form-check pt-1"><input class="form-check-input mt-0 checkQA" value="small" type="checkbox" id="'+n.id+'" data-id="'+n.id+'" ><\/div><\/div><input type="text" class="form-control" placeholder=eg .other answer" id="other'+n.id+'" onchange="getValueCheckboxOther('+n.id+')">'+n.unit+"<\/div>";break;case"header":t='<div class="d-block"><h6 class="text-dark text-sm font-weight-normal px-0">'+n.text+"<\/h6><\/div>";break;case"text":t='<label class="text-dark text-sm font-weight-normal px-0">'+n.text+"<\/label>";break;case"checkbox_img":t=t+'<div class="column" style="position: relative;padding:10px 10px 30px 10px"><img src="/assests/img/pontic/'+n.link+'" class="ui image"><label>'+n.title+'<\/label><br/><div class="ui checkbox" style="position: absolute;bottom: 0;left: 50%;transform: translateX(-50%)"><input type="checkbox" name="small" id="'+n.id+'" class="checkQA" data-id="'+n.id+'" /><label><\/label><\/div><\/div>';break;case"lable_note":t='<label class="text-dark text-sm font-weight-normal px-0">'+n.label+'<\/label><input class="form-control" id="'+n.id+'" onchange="getAnswerDataType_Note('+n.id+')"   />';break;case"textarea":t='<textarea class="form-control" id="'+n.id+'" onchange="getAnswerDataType_Note('+n.id+')" name="content"><\/textarea>'}return t}function EventLinkClick_CheckBoxList(n){$(".checkQA").on("click",function(){var t=$(this).attr("data-id"),r,i;if(this.checked==!1){for(let i=n.length-1;i>=0;i--)if(n[i].id==t){n.splice(i,1);break}}else if(r=document.getElementById("other"+t),r){if(i=$("#other"+t).val()?$("#other"+t).val():"",i!=""){let r={type:"checkother",id:t,text:i};n.push(r)}}else{let i={type:"checkbox",id:t};n.push(i)}})}